import { useMatches } from "react-router-dom";

function Breadcrumbs() {
    let matches = useMatches();
    let crumbs = matches

      .map((match) => match.handle.crumb(match.data));

      //console.log(matches);
      console.log(crumbs);

    return (
      <ol>
        {crumbs.map((crumb, index) => (
          <li key={index}>{crumb}</li>
        ))}
      </ol>
    );
  }

  export default Breadcrumbs;
